// Time:  O(n * m * log (n * m))
// Space: O(1)

class Solution {
    fun arraySorted(m: Int, n: Int, a: IntArray): Array<IntArray> {
        if (n == 1) {
            return arrayOf(a.copyOf())
        }
        // 2-2. Slowest case: m + 1 <= n <= 2*m
        if (m + 1 <= n && n <= 2*m) return sortDiagonal(a, m, n, 2)
        // 2-1. Medium case: m + 1 <= n <= 2*n
        if (m + 1 <= n && n <= 2*n) return sortDiagonal(a, m, n, 1)
        return emptyArray()
    }

    private fun sortDiagonal(a: IntArray, m: Int, n: Int, d: Int): IntArray {
        val mn = Math.min(m, n)
        var i = m + 1, j = m, cnt = 0
        while (i <= n) {
            val v = a[i - 1]
            while (j + d >= 1 && a[j + 1] < v) {
                j++
                cnt++
            }
            a[i - 1] = v
            j--
            cnt--
            i++
        }
        if (cnt != 0) return a
        else return sortDiagonal(a, m, mn, d + 1)
    }
}

